import React from 'react';

function Login() {
    return(
        <div>
            <form>
                <label name='username'>
                    Username:
                    <input type='text' name='username' placeholder='Enter Username'/>
                </label>
                <label name='password'>
                    Password:
                    <input type='text' name='password' placeholder='Enter Password'/> 
                </label>
            </form>
        </div>
    )
}

export default Login;
